import React, {Component} from 'react'

const TableHeader = () => {
  return (
    <thead>
      <th>Nome</th>
      <th>Cargo</th>
    </thead>
  )
}

const TableBody = () => {
  return <tbody />
}

class Table extends Component {
  render () {
    const {characterData} = this.props;
    return (
      <table>
        <TableHeader />
        <TableBody characterData = {characterData}/>
      </table>
    )
  }
}

export default Table
